import React, { useState, useEffect, useRef } from "react";
import axios from "axios";
import { PDFDocument } from "pdf-lib"; // Import pdf-lib in the frontend
import './App.css';

export default function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [numPages, setNumPages] = useState(null);
  const [selectedPages, setSelectedPages] = useState([]);
  const fileInputRef = useRef(null);

  useEffect(() => {
    // Fetch the number of pages from the selectedFile without uploading it to the backend
    if (selectedFile) {
      const reader = new FileReader();

      reader.onload = async () => {
        const pdfBuffer = reader.result;
        try{
        const pdfDoc = await PDFDocument.load(pdfBuffer);
        const numPages = pdfDoc.getPageCount();
        console.log("Frontend Page no: " + numPages);
        setNumPages(numPages);
        }
        catch{
          alert("File type not supported");

          // Reset the file input value
          if (fileInputRef.current) {
            fileInputRef.current.value = "";
          }

          setSelectedFile(null);
          setNumPages(null);
          setSelectedPages([]);

          return;
        }
      };

      reader.readAsArrayBuffer(selectedFile);
    }
  }, [selectedFile]);

  const handleFileChange = (event) => {
    setSelectedFile(event.target.files[0]);
  };

  const handleCheckboxChange = (event, page) => {
    const isChecked = event.target.checked;
    const pageNumber = page;

    setSelectedPages((prevSelectedPages) =>
      isChecked
        ? [...prevSelectedPages, pageNumber]
        : prevSelectedPages.filter((p) => p !== pageNumber)
    );
  };


  const handleSubmit = async (event) => {
    event.preventDefault();

    if (!selectedFile) {
      alert("Please select a PDF file.");
      return;
    }

    const formData = new FormData();
    formData.append("pdfFile", selectedFile);

    // Send selectedPages separately as a JSON object
    const selectedPagesData = {
      selectedPages: selectedPages,
    };

    try {
      const response = await axios.post("http://localhost:5000/upload", formData, {
        headers: { "Content-Type": "multipart/form-data" },
        params: selectedPagesData, // Pass selectedPagesData as query params
        responseType: 'blob', // Tell axios to treat the response as a binary blob
      });

      console.log(response.data); // Log the response from the backend

      // Trigger download by creating a Blob and using a link to initiate the download
      const blob = new Blob([response.data], { type: 'application/pdf' });
      const url = URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', 'modified.pdf');
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);

      // Reset the file input value
      if (fileInputRef.current) {
        fileInputRef.current.value = "";
      }

    } catch (error) {
      alert("Error uploading the file:", error);
      // Handle errors, show error messages, etc.
    }
    setSelectedFile(null);
    setNumPages(null);
    setSelectedPages([]);

  };

  return (
    <div className="main">
      <h1 className="title">Extract Pages from your PDF!</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="pdfFile" className="file-label">
            Select a PDF file:
          </label>
          <input
            ref={fileInputRef}
            type="file"
            className="form-control-file file-input"
            id="pdfFile"
            name="pdfFile"
            onChange={handleFileChange}
          />
          <br />
          {numPages !== null && (
            <div>
              <p className="pages-label">Select Pages to Include:</p>
              {Array.from({ length: numPages }, (_, index) => (
                <label key={index} className="page-label">
                  <span>Page {index + 1}</span>
                  <input
                    type="checkbox"
                    className="form-checkbox"
                    name="selectCheckbox"
                    checked={selectedPages.includes(index + 1)}
                    onChange={(event) => handleCheckboxChange(event, index + 1)}
                  />
                </label>
              ))}
              <br />
              <br />
            </div>
          )}
          <button type="submit" className="submit-button">
            Download Modified PDF
          </button>
        </div>
      </form>
    </div>
  );
}
